def clumpFinder(dna, k, length, clump):
    dictList = []
    finalList = []

    for i in range(len(dna) - length):
        genome = dna[i:i + length]
        dict = {}
        for j in range(len(genome) - k):
            subStr = genome[j:j + k]
            if (dict.get(subStr)):
                dict[subStr] = dict[subStr] + 1
            else:
                dict[subStr] = 1
        dictList.append(dict)

    for dict in dictList:
         for key, value in dict.items():
            if value == clump:
                finalList.append(key)

    return ' '.join(list(set(finalList)))

print(clumpFinder('', 11, 537, 20))